import React from "react";
import Card from './Card';
import DataArray from "./DataArray";
const Container = ({ search }) => <>
    <div className="container">
        {search===''?<h1>HEllo</h1>:<h1>now what</h1>}
        {DataArray.map((current) => 
            <Card
                key={current.id}
                data={current}
            />)
        }
    </div>
</>;

export default Container;
